const Register = () => {
    return ( 
                <div className= "flex h-screen ">
            <div className="m-auto mt-12">
            <div className="pb-8 font-primary2 text-6xl text-center">
                REGISTER
            </div>
            <form className="max-w-3xl" action="">
                <input className="rounded-none appearance-none border bg-gray-200 w-full px-4 py-3 font-primary3 text-grey-500" type="text" placeholder="Username"  required/>
                <input className="rounded-none appearance-none border bg-gray-200 w-full px-4 py-3 font-primary3 text-grey-500" type="email" placeholder="Email"  required/>
                <input className="rounded-none appearance-none border bg-gray-200 w-full px-4 py-3 font-primary3 text-grey-500" type="Password" placeholder="Password"  required/>
                <input className="rounded-none appearance-none border bg-gray-200 w-full px-4 py-3 font-primary3 text-grey-500" type="Password" placeholder="Password"  required/>
                <button className=" rounded-none shadow bg-gray-400 hover:bg-gray-700 my-10 text-white font-bold py-4 px-8 font-primary2  focus:outline-none focus:shadow-outline">LOGIN</button>
                
            </form>
            </div>
        </div>
     );
}
 
export default Register;
